    //***********************useful fonctions ******************/
    function getFormatedDate(date) {

        var date = new Date(date)
        var day = date.getDate();
        var month = date.getMonth() + 1;

        var year = date.getFullYear()

        switch (month) {
            case 1:
                month = 'Janvier';
                break;
            case 2:
                month = 'Fevrier';
                break;

            case 3:
                month = 'Mars';
                break;
            case 4:
                month = 'Avril';
                break;
            case 5:
                month = 'Mai';
                break;
            case 6:
                month = 'Juin';
                break;
            case 7:
                month = 'Juillet';
                break;
            case 8:
                month = 'Aot';
                break;
            case 9:
                month = 'Septembre';
                break;
            case 10:
                month = 'Octobre';
                break;
            case 11:
                month = 'Novembre';
                break;
            case 12:
                month = 'Dcembre';
                break;
        }

        if (day < 10) {
            return "0" + day + " " + month + " " + year;
        } else {
            return day + " " + month + " " + year;
        }



    }
